import React from 'react';
import './styles.css';

function App() {
  return (
    <div className="App">
      <header className="app-header">
        <h1 className="app-title">Image Puzzle Solver</h1>
        <p className="app-subtitle">A modern web interface for solving image puzzles</p>
      </header>
      <main>
        <div className="app-card">
          <p>Welcome! Start building your image puzzle solver features here.</p>
        </div>
      </main>
    </div>
  );
}

export default App;
